import React from "react";
import { Link } from "react-router-dom";

export default function Register() {
  const navigate = useNavigate();
const location = useLocation();
const fromPage = location.state?.from?.pathname || '/';

  return (
    <section className="login">
      <h2 className="login__title">Регистрация</h2>
      <form method="post" className="login__form" name="register">
        <input type="email" className="login__input" placeholder="Email" />
        <input type="password" className="login__input" placeholder="Пароль" />
        <input type="submit" className="login__submit" value={'Зарегистрироваться'}/>
      </form>
      <span className="login__text">Уже зарегистрированы? <Link to='/sign-in' className="login__link">Войти</Link></span>
    </section>
  );
}
